import styled from '@emotion/styled'
import React from 'react'
import PendingInvitationsListItems from './PendingInvitationsListItems'
import { connect } from 'react-redux'

const MainContainer = styled("div")({
    width: "100%",
    height: "22%",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    overflow: "auto",
})

const Dummy=[
{
    id:1,
    email:"sami@gmail.com",

}
]


function PendingInvitationsList({ pendingFriendsInvitations }) {
    console.log(pendingFriendsInvitations,"invitations")
    return (
        <MainContainer>
            {
                 pendingFriendsInvitations?.map((invitation) => (
                    <PendingInvitationsListItems

                        username={invitation.senderId.username}
                        id={invitation._id}
                        key={invitation._id}
                        mail={invitation.senderId.mail}

                    />

                ))
            }

        </MainContainer>
    )
}

const mapStoreStatetoProps = ( {friends} ) => {
    console.log(friends,"frnds")
    return {
        ...friends,
    };
};

export default connect(mapStoreStatetoProps)(PendingInvitationsList)
